var process_html_output=function(a){var b="<div>request (#"+a.req_no+") -- "+a.type+'<br /><table class="out-table" border="1"><tr>';for(out in a.output)b=b+'<th class="tb-header">'+out+"</th>";b+="</tr> <tr>";for(val in a.output)b=b+"<td>"+a.output[val]+"</td>",console.log(a.output[val]);b+="</tr></table></div><br />",$("#result").append(b)},main=function(){$("#form-submit").click(function(a){console.log("I am clicked");var b=$("select").val(),c=$("input[name=val]").val(),d="http://localhost:8000/api/"+b,e={option:b,val:c};$.ajax({type:"POST",url:d,data:e,dataType:"json",encode:!0}).done(function(a){switch(a.type){case"hash":process_html_output(a);break;case"counter":process_html_output(a);break;case"global-counter":process_html_output(a)}}).then(function(){$("input").val("")}),a.preventDefault()})};$(document).ready(main);